    <div>
    <div className="row mt-2 height: 100px">
      <div className="col-4 text-center">
        <img src={logoGeo } class="img-fluid" alt="..."/>
      </div>
      <div className="col-4 text-center">this is header</div>
      <div className="col-4 text-center">this is header</div>
    </div>
    </div>
  );
}
